import React from 'react'
import Banner from '../components/Banner/Banner'
import error from '../assets/404_new.png'

export default function NotFound() {
  return (
    <div>
        <Banner>
          <img src={error} alt='not found' style={{margin: '0 auto'}}/>
        </Banner>
    </div>
  )
}
